### JavaScript

```javascript
"use strict";

function trimMean(arr) {
    const n = arr.length;
    const start = parseInt(n * 0.05);
    const end = parseInt(n * 0.95);
    arr.sort((a, b) => a - b);
    const t = arr.slice(start, end);
    return parseFloat((t.reduce((a, b) => a + b, 0) / t.length).toFixed(5));
}
